  return (
    <div
      onClick={() => {
        if (window.confirm('Voulez-vous vraiment supprimer ce post ?')) {
          deleteQuote()
        }
      }}
    >
      <img src="./img/icons/trash.svg" alt="trash" />
    </div>
  )
}
export default DeleteCard
